// App.js
import React from 'react';
import { BrowserRouter as Router, Switch, Route, Link } from 'react-router-dom';
import ConferenceForm from './conference';
import PagosExtrasPage from './Extras';

const App = () => {
  return (
    <Router>
      <div>
        <Link to="/pagos-extras">Pagos Extras</Link>
        <Switch>
          <Route exact path="/" component={ConferenceForm} />
          <Route path="/pagos-extras" component={PagosExtrasPage} />
        </Switch>
      </div>
    </Router>
  );
};

export default App;
